import React from "react";
import "./card.css";
class Card extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className="homeCard">
        <div className="icon">
          <i class="fa-regular fa-users"></i>
        </div>
        <div className="content">
          <h2 className="title">Trusted By Clients</h2>
          <h5 className="description">
            We operate on a client-first approach & have a long record of
            satisfied clients who rely on us for their business needs. We always
            go the extra mile to ensure our client's happiness and satisfaction.
          </h5>
        </div>
      </div>
    );
  }
}
export default Card;
